import React from "react";
import "./firstsection.css";
import bg1 from "./bg1.png";
import bg2 from "./bg2.png";
import respbg1 from "./respbg1.png";
import respbg2 from "./respbg2.png";
import man from "./man.png";
import respman from "./respman.png";
import drop from "./drop.png";

function Firstsection() {
  return (
    <div className="firstsection">
      <div className="bgg">
        <div className="background">
          <img src={bg1} className="bg" alt="background" />
          <img src={bg2} className="bg" alt="background" />
          <img src={respbg1} className="respbg" alt="background" />
          <div className="resgreen-container">
            <img src={respbg2} className="respbg resgreen" alt="background" />
            <h1>Hello</h1>
          </div>
        </div>
        <div className="box">
          <img src={respman} alt="charecter" />
        </div>
      </div>
    </div>
  );
}

export default Firstsection;
